import React from "react";
import Pomodoro from "../components/Timer/Pomodoro";
import { Card, CardContent, Grid, ListItem, ListItemIcon, ListItemText, Typography } from "@material-ui/core";
import { List } from "css-tree";
import { keys } from "prelude-ls";

function TimerPage() {

  const cardContent = [
    {
      text: "Make a To Do List"
    },

    {
      text: "Start the timer and work for 25 minutes"
    },

    {
      text: "Take a 5 minute break"
    },

    {
      text: "Do it  all over again"
    },

  ]

  return (
    <div>
      <Typography variant="h3" align="center">
        Study Timer
      </Typography>
      <Grid container>
        <div align="center" style={{ padding: "0px 0" }}>
          <Pomodoro />
        </div>
      </Grid>
      <Grid>
        <Card>
          <CardContent>
            <Typography variant="h7">
              Study Technique
            </Typography>
            <Typography variant="h5" style={{marginTop: "4px"}}>
              Pomodoro
            </Typography>
            <Typography style={{marginTop: "4px"}}>
              The Pomodoro Technique is a great study 
              tool to help combat distractions, build 
              consistency in results and to make it 
              easier to get started.
            </Typography>
            <br/>
            <Typography>
              To get started:
            </Typography>
            <List>
                <ListItem>
                  <ListItemText primary="Make a To Do List"/>
                </ListItem>
            </List>
          </CardContent>
        </Card>
      </Grid>
    </div>
  );
}

export default TimerPage;
